import Navbar from "../components/Navbar"
import bg from "../Assest/bg.jpg"
const Home = () =>{
    return (
        <div>
            <Navbar/>
            <div class="container">
            <img class="img-bg" src={bg} alt="Snow" style="width:100%;"/>
            <div class="bottom-left">Bottom Left</div>

</div>
           
        </div>
    )
}

export default Home;
